import { useState } from "react";
import Female from './Female.jpeg'


const Employee = () => {
  const [employees, setEmployees] = useState([
    {
      id: 1,
      name: "umair",
      company: "netflix",
      sex: "male"
    },
    {
      id: 2,
      name: "john",
      company: "meta",
      sex: "male"
    },
    {
      id: 3,
      name: "saif",
      company: "google",
      sex: "male"
    },
    {
      id: 4,
      name: "amna",
      company: "netflix",
      sex: "female"
    },
    {
      id: 5,
      name: "khan",
      company: "google",
      sex: "male"
    }
  ]);

  return (
    <main className="container">
      <div class="row">
        <div class="col-8">
      {
        employees.map((employee) => {
          <div id={employee.id} className="card">
            <img src="{Female}" className="card-img-top" />
            <div className="">

            </div>

          </div>
        })
      }
      </div>
      </div>
    </main>
  );
};

export default Employee;
